$(document).ready(function() {
    var table;

    // Check if DataTable is already initialized
    if (!$.fn.DataTable.isDataTable('#diamondtb')) {
        // Initialize DataTable
        table = $('#diamondtb').DataTable({
            "language": {
                "emptyTable": "No data available in table"
            }
        });
    } else {
        table = $('#diamondtb').DataTable();
    }

    $('#searchdiamond').on('click', function(event) {
        event.preventDefault(); // Prevent default form submission behavior

        let d_shape = $('#inputshape').val();
        let d_color = $('#inputcolor').val();
        let d_clarity = $('#inputclarity').val();
        let d_cut = $('#inputcut').val();
        let d_pol = $('#inputpolish').val();
        let d_sym = $('#inputsym').val();

        // Clear existing rows from the table
        table.clear();

        // Populate the DataTable with search results
        D_DATA.forEach(function(item) {
            if (item["Shape"] === d_shape || 
                item["Color"] === d_color || 
                item["Clarity"] === d_clarity || 
                item["Cut"] === d_cut || 
                item["Sym"] === d_sym || 
                item["Pol"] === d_pol) {
                
                let rowData = [];
                for (let key in item) {
                    rowData.push(item[key]);
                }
                table.row.add(rowData);
            }
        });

        // Draw the table after adding rows
        table.draw();
    });
});
